import react, {Component} from "react";
import { setUserSession } from './Utils/Common';
import logo1 from "./assets/img/logo1.png";
import OtpInput from "react-otp-input";
import $ from "jquery";

import IndexNavbar from "./components/Navbars/IndexNavbar2.js";
import Footer from "./components/Footers/Footer";

import swal from "sweetalert";
import "./register.css";

export default class Bayar extends Component{

    state = { otp: "" };

    handleChange = otp => {
        this.setState({ otp })
        console.log(otp);
    };

    render() {

        $('.digit-group').find('input').each(function() {
            $(this).attr('maxlength', 1);
            
            $(this).on('keyup', function(e) {
                var parent = $($(this).parent());
                
                if(e.keyCode === 8 || e.keyCode === 37) {
                    var prev = parent.find('input#' + $(this).data('previous'));
                    
                    if(prev.length) {
                        $(prev).select();
                    }
                } else if((e.keyCode >= 48 && e.keyCode <= 57)  || e.keyCode === 39) {
                    var next = parent.find('input#' + $(this).data('next'));
                    
                    if(next.length) {
                        $(next).select();
                    } else {
                        if(parent.data('autosubmit')) {
                            parent.submit();
                        }
                    }
                } else if(e.keyCode >= 65 && e.keyCode <= 90){
                    $(this).val("");
                }
            });
        });
        
    return (
        <div className="bg-gray">
        <IndexNavbar fixed />
        <section className="py-20 px-5 relative" style={{background: "rgb(34,81,122)", background: "linear-gradient(90deg, rgba(34,81,122,1) 0%, rgba(27,147,171,1) 100%)"}}>
        <div class="min-h-screen flex items-center justify-center  px-4 sm:px-6">
            <div class="max-w-md w-full" style={{marginTop: "-200px"}}>
                <div>
                <img class="mx-auto w-auto" src={logo1} alt="mymps" style={{height: "120px"}}/>
                <h2 class="mt-6 text-center text-xl leading-9 font-extrabold text-white">
                    Laman Bayaran Cukai Ekpress
                </h2>
                </div>
                <form class="mt-8" action="#" method="POST">
                <input type="hidden" name="remember" value="true" />
                <div class="w-full mx-auto rounded-md">
                <div class="prompt">
                    Sila masukkan nombor Kad Pengenalan anda
                </div>
                    <form method="get" class="digit-group" data-group-name="digits" data-autosubmit="false" autocomplete="off">
                        <input type="text" id="digit-1"  name="digit-1"  data-next="digit-2" />
                        <input type="text" id="digit-2"  name="digit-2"  data-next="digit-3" data-previous="digit-1" />
                        <input type="text" id="digit-3"  name="digit-3"  data-next="digit-4" data-previous="digit-2" />
                        <input type="text" id="digit-4"  name="digit-4"  data-next="digit-5" data-previous="digit-3" />
                        <input type="text" id="digit-5"  name="digit-5"  data-next="digit-6" data-previous="digit-4" />
                        <input type="text" id="digit-6"  name="digit-6"  data-next="digit-7" data-previous="digit-5" />
                        <input type="text" id="digit-7"  name="digit-7"  data-next="digit-8" data-previous="digit-6" />
                        <input type="text" id="digit-8"  name="digit-8"  data-next="digit-9" data-previous="digit-7" />
                        <input type="text" id="digit-9"  name="digit-9"  data-next="digit-10" data-previous="digit-8" />
                        <input type="text" id="digit-10" name="digit-10" data-next="digit-11" data-previous="digit-9" />
                        <input type="text" id="digit-11" name="digit-11" data-next="digit-12" data-previous="digit-10" />
                        <input type="text" id="digit-12" name="digit-12" data-previous="digit-11" />
                    </form>
                </div>

                <div class="mt-6">
                    <button type="button" class="group relative w-full flex justify-center py-2 px-4 border border-transparent text-sm leading-5 font-medium rounded-md text-white bg-green-600 hover:bg-green-500 focus:outline-none focus:border-indigo-700 focus:shadow-outline-indigo active:bg-indigo-700 transition duration-150 ease-in-out">
                        Semak Akaun
                    </button>
                </div>
                </form>
            </div>
        </div>
        </section>
        <Footer />
        </div>
    )
    }
}
